function App8(Props) {
    return (
        <div>

            <h3>functional components</h3>
            <p>name:{Props.name}</p>
            <p>age:{Props.age}</p>
            <p>city:{Props.city}</p>
            <p>state:{Props.state}</p>
            <p>country:{Props.country}</p>
        </div>
    )


}
function Props() {
    return (
        <div>
            <App8 name="harikrishna" age="22" city="jammalmadugu" state="andhrapradesh" country="india" />

        </div>
    )


}
